import React from "react";
import { u_name, u_pass} from "../server";

class ProfilePage extends React.Component {
  render() {
    return (
      <div>
        <h1>Cтраница с произвольным текстом, недоступная без авторизации</h1>
        <h2>{u_name}</h2>
        <h2>{u_pass}</h2>
      </div>
    );
  }
}

export default ProfilePage;
